content:
Anlık Türkiye ;
Çay var içersen , yol var geçersen..

#cuma

Resûlullah Efendimiz ﷴ şöyle buyurmuştur:

“En faziletli günlerinizden biri #cuma günüdür. O gün bana çokça salavat getirin, sizin salavatınız bana ulaştırılır.”

{ Ebû Dâvûd, Vitir, 26 }

İmam Ali #Hamaney: Allah'ın izniyle sevgili halkımız kurallara uyarsa pandemi 2 ila 3 ay içinde daha az olacak. Ve Allah'ın izniyle, aşılar birkaç ay içinde bolca bulunabilecek. Allah'ın izniyle sorunlar azalacaktır ya da çözülecektir. 
@tr_khamenei_ir
 #cuma #Covid_19
